import React, { useContext } from 'react';
import UserContext from '../contexts/UserContext';

const UserList = () => {
  const { users } = useContext(UserContext);

  return (
    <div>
      {
        users ? 
          <ul>
            {users.map(user => {
              return (
                <li key={user.id} user={user}>{user.username}</li>
              );
            })}
          </ul> :
          <h1>Loading users...</h1>
      }
    </div>
  )
}

export default UserList;
